http://thrace-music.com

THRACE MUSIC is an independent record label founded in 2012 by producer and artist Cristian Tarcea (Monoir).

With more than 12 years of musical experience, Cristian Tarcea has grown into becoming one of the leading producers in Romania and Eastern Europe, alongside of building a strong team of talented people and one of the most successful labels in his territory.

Housing artists such as Brianna, Kate Linn, Dharia, Iarina, YNGA, Sandra N., Monoir, 3RIN and Qupra, we are constantly collaborating with other artists/partners in the music industry from all over the world.

With a passion for musical quality  building our teams careers and with a genuine respect for our fans, we are hands on with our work to make sure you get the best music!
